import React, { Component } from 'react'
import "../../../styles/personalInfo/personalInfo"
export default class PersonalInfo extends Component {
    constructor(props) {
        super(props);
    }
    redirect() {
        if (!this.props.redirectURL) return console.log("redirect !")
    }
    render() {
        return (
            <div>
                <div className="tableWrapper">
                    <div className="title">
                        {this.props.columnHearder.map((headerName, title) => {
                            return <p key={title}>{headerName}</p>
                        })}
                        {/* </div>
                    <div className="data"> */}
                        {this.props.rowData.map(dataRow => {
                            // { console.log("Data in row " + dataRow) }
                            {
                                dataRow.map(cellData => {
                                    console.log("celldata " + cellData)
                                    return <p>{cellData}</p>
                                })
                            }
                        })}
                    </div>
                </div>
            </div>
        );
    }
}
